import {component} from "react";
import {Routes, Route} from "react-router-dom";

import Home from "./router";
import About from "./router";

function App() {
    return <div>
        <Routes>
            <Route exact path="/" component={Home} />
            <Route path="/about" component={About} />
        </Routes>
    </div>
}

export default App;
